import React from "react";

class SavingsResult extends React.Component {

    render() {
        let yourRate = this.props.yourRate;
        let customerRate = this.props.customerRate;
        let savings = Number(customerRate - yourRate);
        return (
            <div>
                <p>We can save you up to {savings}!</p>
            </div>
        )
    }

}

export default SavingsResult;
